import React from "react";
import ReactDOM from "react-dom";
import Sdata from "./Sdata"
import Card from "./Cards";


//use map function to avoid rewriting of card

function Card_values(val){
      (val.img).map(function(c){
            console.log(c);            

      });
      return (    


      <Card imgSrc={c} 
            title={val.title}
            sname={val.name} 
            link={val.link}/>




);
}
ReactDOM.render(
                <>
                <h1>List of Top 5 Netflix web Series</h1>
                  {Sdata.map(Card_values)}

                </>,
                document.getElementById("root")

);
